    <main>
      <button className="sidebar-toggle">
        <FaBars></FaBars>
      </button>
    </main>
  );
}

function Modal(params) {
  return <div></div>;
}

function Sidebar(params) {
  return <div></div>;
}

export const NavApp = () => {
  return (
    <>
      <Home></Home>
      <Modal></Modal>
      <Sidebar></Sidebar>
    </>
  );
};
